    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Connectez vous{% endblock %}
{%block addStyleSheets%}
<link rel=\"stylesheet\" href=\"{{asset('bower_components/css/Login.css')}}\">
<link rel=\"stylesheet\" href=\"{{asset('bower_components/css/utilLogin.css')}}\">
{% endblock %}

{% block body %}
<div class=\"limiter\">
    <div class=\"container-login100\">
        <div class=\"wrap-login100\">
            <form method=\"post\" class=\"login100-form validate-form\">
                <span class=\"login100-form-title p-b-26\">
                    Bienvenue
                </span>

                <span class=\"login100-form-title p-b-48\">
                    <i class=\"zmdi zmdi-font\"></i>
                </span>

            {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

                <div class=\"wrap-input100 validate-input\" data-validate = \"Valid email is: a@b.c\">
                    <input class=\"input100\"  value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" type=\"email\" required autofocus>
                    <span class=\"focus-input100\" data-placeholder=\"Email\"></span>
                </div>
                
                <div class=\"wrap-input100 validate-input\" data-validate=\"Enter password\">
                    <span class=\"btn-show-pass\">
                        <i class=\"zmdi zmdi-eye\"></i>
                    </span>
                    <input class=\"input100\" type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" required >
                    <span class=\"focus-input100\" data-placeholder=\"Password\"></span>
                </div>
    <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
                <div class=\"container-login100-form-btn\">
                    <div class=\"wrap-login100-form-btn\">
                        <div class=\"login100-form-bgbtn\"></div>
                        <button class=\"login100-form-btn\">
                            Connexion
                        </button>
                    </div>
                </div>

            </form>
        </div>
    </div>
</div>






  {#
    <h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
    <label for=\"inputEmail\">Email</label>
    <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" required autofocus>
    <label for=\"inputPassword\">Password</label>
    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\"
    >

  
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}

{% endblock %}
